        height: 80px;
        margin-top: 35px;
        .button {
          background-color: #ff4565;
          border-radius: 7px;
        }
      }
    }
  }

  .point-dialog {
    width: 100%;
    max-width: 686px;
    height: auto;
    padding: unset;
    background-color: #f5e8eb;
