      line-height: 83px;
      padding-left: 42px;
      font-size: 29px;
      color: #fff;
      background-color: #fb3a67;
      text-align: left;
    }
    .content {
      width: 100%;
      padding: 40px 32px 58px 32px;
      font-size: 26px;
      color: #13161b;
      text-align: justify;
      .text-bold {
        font-size: 28px;
        font-weight: bold;
      }
      .get-point-way {
        margin-top: 30px;
      }
      .notice-tips {
        margin-top: 50px;
      }
      img {
        width: 100%;
        margin-top: 20px;
      }
    }

    .van-dialog__footer {
      padding: 35px 0;
      justify-content: center;
      background-color: #ffdbe3;
    }
    .van-dialog__confirm {
      flex: 0 0 313px;
      height: 80px;
      background: #ff4565;
      font-size: 31px;
      border-radius: 7px;
